import React from 'react';
import DonutLargeIcon from "@material-ui/co";
import "./Sidebar.css";

function Sidebar() {
    return (
        <div className='sidebar'>
         <div className="sidebar__header">
             <div className="sidebar__headerRight">
                 <DonutLargeIcon />


            </div>
         </div>
        </div>
    )
}

export default Sidebar
